import {useParams} from 'react-router-dom'

function BlogPage(props){

    let {id}=useParams();

    return(
        <div className="blog-page">
            <h1>{id}</h1>
            <p>{props.content}</p>
            <span>{props.category}</span>
        </div>
    )
}

export default BlogPage;
